.panel-group {
  margin-bottom: 10px;
  .card-panel {
    border-radius: 4px;
    background: #fff;
    display: flex;
    padding: 34px 25px;
    background-image: url("../../../../assets/images/home/bg.png");
    background-size: cover;
    background-position: center;
    .icon-people,
    .icon-message,
    .icon-money,
    .icon-shopping {
      width: 75px;
      height: 75px;
      text-align: center;
      line-height: 89px;
      border-radius: 50%;
      margin-right: 32px;
      flex-shrink: 0;
    }
  }
  .card-panel-num {
    font-size: 20px;
    font-weight: 600;
  }
  .card-panel-text {
    margin-top: 4px;
    font-size: 14px;
    color: #666;
  }
}
